        <link type="text/css" href="files/mobile.css" rel="stylesheet" class="native-dark-class-original"><style lang="en" type="text/css" native-dark-index="0" class="native-dark-class-cloned">@charset "utf-8";
/* CSS Document */		 
body {overflow-x: hidden;}
		 
h1, h2, h3, h4, h5, h6,
h1.subheader, h2.subheader, h3.subheader, h4.subheader, h5.subheader, h6.subheader,
h1.small, h2.small, h3.small, h4.small, h5.small, h6.small,
p,
ul,
ol,
li,
blockquote,
table, tr, th, td, 
dl, dt, dd,
a,
div, span{
	font-smooth:always;
	-webkit-font-smoothing: antialiased;
}

a:focus {
	/*outline:none;*/
}

h1{	
	font-size:34px;
	font-family: 'Roboto', sans-serif;
	font-weight:300;
	color:#333333;
	line-height:38px;
}

h2{
	font-size:27px;
	font-family: 'Roboto', sans-serif;
	font-weight:300;
	color:#333333;
	line-height:32px;
}

h3{
	font-size:24px;
	font-family: 'Roboto', sans-serif;
	font-weight:300;
	color:#333333;
	line-height:25px;
}
h4{
	font-size:20px;
	font-family: 'Roboto', sans-serif;
	font-weight:400;
	color:#333333;
	line-height:24px;
}
h5{
	font-size:18px;
	font-family: 'Roboto', sans-serif;
	font-weight:400;
	color:#333333;
	line-height:22px;
}
h6{
	font-size:16px;
	font-family: 'Roboto', sans-serif;
	font-weight:400;
	color:#333333;
	line-height:20px;
}

.page_title_container > h1 + h2 {
	margin: 25px 0 20px;
}

p{
	font-size:14px;
	font-family: 'Roboto', sans-serif;
	font-weight:400;
	line-height:21px;
	color:#333333;
}

.normal{font-size: 14px !important;}

p em, p i{
	font-style:italic;
}

p strong, p b{
	font-style:bold;
	color:#333333;
}

p.x-large, span.x-large{
	font-size:21px;
	font-weight:300;
	font-style:normal;
	line-height:27px;
	color:#666666;
}

p.large, span.large{
	font-size:16px;
	font-weight:400;
	font-style:normal;
	line-height:24px;
	color:#333333;
}

p.medium, span.medium{
	font-size:14px;
	font-weight:500;
	font-style:normal;
	line-height:21px;
	color:#333333;
}

p.small,span.small, ol.x-small, ul.x-small{
	font-size:13px;
	font-weight:400;
	font-style:normal;
	line-height:19px;
	color:#333333;
}

p.x-small,span.x-small, ol.x-small, ul.x-small{
	font-size:11px;
	font-weight:300;
	font-style:normal;
	line-height:17px;
	color:#333333;
}



ul{
	font-size:14px;
	font-weight:400;
	color:#333333;
	list-style:disc;
}

ul li {padding-bottom:5px;}

ol{
	font-size:14px;
	font-weight:400;
	color:#333333;
}

ol li{padding-bottom:5px;}

a{
	color:#107cc0;
	text-decoration: none;
}

/*
a:visited{
	color:#86badb;
}
*/

a:hover{
	color:#6daad0;
	text-decoration: none;
}

.ui-widget-content a {
	color:#107cc0;
	text-decoration: none;
}

/*New anchor styles to offset relative header*/
a.anchor {display: block; position: relative; top: -115px;visibility: hidden;/*height:1px;background:pink;*/}
body.hasAlertMessaging a.anchor {top: -200px;}
@media only screen and (max-width: 64.063em){
	a.anchor {top: -85px;}
	body.hasAlertMessaging a.anchor {top: -170px;}
}

a.button, input[type='submit'].button{background:#087cc0;color:#fff; webkit-border-radius:2px;-moz-border-radius:2px;border-radius:2px;}
a.button:hover, input[type='submit'].button:hover{background:#076399;text-decoration: none; color:#fff;}
a.button.selected, input[type='submit'].button.selected{background:#076399; color:#fff;}
a.button.disabled, input[type='submit'].button.disabled{background:#daeaf5  !important; color:#999999 !important;}

input.secondary[type="button"], input.secondary[type="reset"], input.secondary[type="submit"], button.secondary, .button.secondary { border: 1px solid #0467C6; color: #0467C6; background-color: transparent; line-height: 1.375rem;}
input[type="button"].secondary:hover, input[type="button"].secondary:focus, input[type="reset"].secondary:hover, input[type="reset"].secondary:focus, input[type="submit"].secondary:hover, input[type="submit"].secondary:focus, button.secondary:hover, button.secondary:focus, .button.secondary:hover, .button.secondary:focus { border:1px solid #004990; background-color:transparent; color:#004990; box-shadow:0 0 0 1px #004990;}

a.button.light, input[type='submit'].button.light{background:#daeaf5;color: #087cc0;}
a.button.light.selected, input[type='submit'].button.light.selected{background:#bad8ec;}
a.button.light:hover, input[type='submit'].button.light:hover{background:#bad8ec;}
a.button.light.disabled, input[type='submit'].button.light.disabled{background:#e5e5e5; color:#999;}

a.button.margin-right, input[type='submit'].button.margin-right{margin-right: 15px;}
a.button.margin-left, input[type='submit'].button.margin-left{margin-left: 15px;}
a.button.nomargin, input[type='submit'].button.nomargin{margin:0;}

select, textarea, input[type="text"], input[type="password"], input[type="date"], input[type="datetime"], input[type="datetime-local"], input[type="month"], input[type="week"], input[type="email"], input[type="number"], input[type="search"], input[type="tel"], input[type="time"], input[type="url"], textarea {
    border-radius: 3px;
    color: #333;
    font-size: 1rem;
    font-weight: 400;
    height: 46px;
    margin: 0 0 20px;
    padding: 10px 17px;
}

input.hasDatepicker[type="text"], input.hasDatepicker[type="text"]:focus {
    background: url('assets/capi/calendar.gif') no-repeat scroll 12px 12px rgba(0, 0, 0, 0);
	padding-left: 38px;
	padding-right: 5px;
}

button, .button{
	font-size:18px;
	font-family: 'Roboto', sans-serif;
	font-weight: 400;
	color:#FFFFFF;
	padding: 10px 30px;
	/*outline: none; 04-01-2018: removed for accessibility reasons */
}

button.medium, .button.medium{
	font-size:14px;
	font-family: 'Roboto', sans-serif;
	font-weight:500;
	color:#FFFFFF;
	padding:8px 20px;
}

button.small, .button.small{
	font-size:12px;
	font-family: 'Roboto', sans-serif;
	font-weight:normal;
	color:#FFFFFF;
	padding: 3px 15px 4px 15px;
}

button.grey, .button.grey{
	color:#107CC0;
	background-color:#E5E5E4;
}

td button, td .button, th button, th .button, .button.flip_margin, button.flip_margin {margin-bottom: 0;}
.button.flip_margin, button.flip_margin {margin-top: 25px;}

.blue-txt{color:#1c85c6;}

.ls-canvas .ls-area, .ls-canvas .ls-area-body { overflow: visible !important;}
.search-container .ls-canvas .ls-area, .search-container .ls-canvas .ls-area-body { overflow: visible !important;}
		 
