/*---- jCarousel ----*/
#blueBar-slider.jcarousel-wrapper {   
    position: relative;	
	margin-top: 0;
	height: 150px;
}

#blueBar-slider .jcarousel {
    position: relative;
    overflow: hidden;	
}

#blueBar-slider .jcarousel ul {
    width: 20000em;
    position: relative;
    list-style: none;
    margin: 0;
    padding: 0;
}

#blueBar-slider .jcarousel li {
    float: left;
}

#blueBar-slider .jcarousel img {
    display: inline;
    max-width: 100%;
    height: auto !important;
}

#blueBar-slider .clearfix div {
	position: relative;
	padding-top: 1.75rem;
	padding-top: 28px;
	left: 10%;
	width: 80%;
}

/** Carousel Controls **/

#blueBar-slider .jcarousel-control-prev,
#blueBar-slider .jcarousel-control-next {
    position: absolute;
    top: 50%;
    margin-top: -10px;
    width: 32px;
    height: 32px;
    text-align: center;
    /*background: #4E443C;
    color: #fff;
    text-decoration: none;
    text-shadow: 0 0 1px #000;
    font: 24px/27px Arial, sans-serif;
    -webkit-border-radius: 30px;
