    border-radius: 30px;
    -webkit-box-shadow: 0 0 4px #F0EFE7;
    -moz-box-shadow: 0 0 4px #F0EFE7;
    box-shadow: 0 0 4px #F0EFE7;*/
}

#blueBar-slider .jcarousel-control-prev {
	background-image: url('assets/capi/en/home/Arrow3_Left_White_128x128.png');
	background-position: 0 0;
	background-repeat: no-repeat;	
	background-size: 32px 32px; 
	left: 0;
}

#blueBar-slider .jcarousel-control-next {
	background-image: url('assets/capi/en/home/Arrow3_Right_White_128x128.png');
	background-position: 0 0;
	background-repeat: no-repeat;    
    background-size: 32px 32px; 
	right: 0;
}

#blueBar-slider .jcarousel-control-next:hover {
	background-image: url('assets/capi/en/home/Arrow3_Right_Normal_128x128.png');
	background-position: 0 0;
	background-repeat: no-repeat;    
    background-size: 32px 32px; 
	background-color: transparent;
	right: 0;	
}

#blueBar-slider .jcarousel-control-prev:hover {
	background-image: url('assets/capi/en/home/Arrow3_Left_Normal_128x128.png');
	background-position: 0 0;
	background-repeat: no-repeat;    
    background-size: 32px 32px; 
	background-color: transparent;	
	left: 0;
}

@media (max-width: 480px) {
#blueBar-slider .jcarousel-control-prev,
#blueBar-slider .jcarousel-control-next {
        margin-top: -10px;
        width: 20px;
        height: 20px;
        border-radius: 20px;
        font: 16px/18px Arial, sans-serif;
    }
}

/*#blueBar-slider .jcarousel-control-prev {
    left: 15px;
}

#blueBar-slider .jcarousel-control-next {
    right: 15px;
}*/

#blueBar-slider .jcarousel-control-prev:hover span,
#blueBar-slider .jcarousel-control-next:hover span {
    display: block;
}

#blueBar-slider .jcarousel-control-prev.inactive,
#blueBar-slider .jcarousel-control-next.inactive {
    opacity: .25;
    cursor: default;
}

/** Carousel Pagination **/

#blueBar-slider .jcarousel-pagination {
    position: absolute;
    bottom: 10px;
    left: 50%;
    margin: 0 0 12px -22px;
}

#blueBar-slider .jcarousel-pagination a {
    text-decoration: none;
    display: inline-block;
    font-size: 11px;    
    line-height: 10px;
    background: none repeat scroll 0 0 #74aacc;
    height: 0.625rem;
    width: 0.625rem;
	height: 10px;
    width: 10px;    
    border-radius: 10px;
    text-indent: -9999px;
    margin-right: 7px;
    
}

#blueBar-slider .jcarousel-pagination a.active {
    background: #fff;
    color: #8b8b8b;
    opacity: 1;
  
}

@media (max-width: 620px) {
    #blueBar-slider .jcarousel-pagination {
        bottom: -35px;
    }
}





/*-----------------------------
FEEDBACK TAB STYLES
------------------------------*/

.feedback-tab{display:none;}

#feedback-tab { 
	position: fixed;
	top: 75%;
	right: 0px;
	width: 100px;
	height: 0px;
	text-align:right;
	z-index:9999;
	margin-top:-15px;				
}

#feedback-tab a { 
    transform: rotate(-90deg);
	-webkit-transform: rotate(-90deg); 
	-moz-transform: rotate(-90deg); 
	-o-transform: rotate(-90deg); 
	filter: progid:DXImageTransform.Microsoft.BasicImage(rotation=3);
    display: block; 
    background: #d72c26; 
    text-align:center;
    height: 50px; 
    width: 134px;
    padding: 10px 0px 8px;
    margin:10px;
    color: #fff!important; 
    font-family: Arial, sans-serif; 
    font-size: 17px; 
    font-weight: bold; 
    text-decoration: none; 
    /*border-bottom: solid 1px #333; border-left: solid 1px #333; border-right: solid 1px #fff;*/
}

#feedback-tab a:hover { 
	background: #a71311; 
}


@media only screen and (max-width: 40em) { /* Small */
	#feedback-tab{display: none;}
}


