    z-index: 9999;
    border-radius: 50px;
    display: flex;
    justify-content: center;
    padding-left: 20px;
    padding-right: 20px;
    background-color: #0467c6;
}
  
.chatBtn img {
      padding: 0;
      height: 100%;
      width: 29px;
}

.chatBtn__final {
    width: 50px;
    border-radius: 50%;
    padding: 0;
}
  
.chatBtn__final div {
    display: none;
}

.chatText {
    display: inline-block;
    padding-left: 10px;
    align-items: center;
    display: flex;
}

.chatText {
    -webkit-animation: chat-button-collapse-text 500ms 4000ms;
    animation: chat-button-collapse-text 500ms 4000ms;
}

@-webkit-keyframes chat-button-collapse-text {
    100% {
        width: 0;
    }
}
@keyframes chat-button-collapse-text {
    100% {
        width: 0;
    }
}

.chatBtn {
    -webkit-animation: chat-button-slide-in-right 3000ms 1000ms ease-in both;
	        animation: chat-button-slide-in-right 3000ms 1000ms ease-in both;
}

@-webkit-keyframes chat-button-slide-in-right {
    0% {
      -webkit-transform: translateX(200%);
      transform: translateX(200%);
    }
    50% {
        -webkit-transform: translateX(0%);
        transform: translateX(0%);
    }
    60% {
        filter: brightness(80%);
    }
    80%{
        filter: brightness(120%);
    }
    100% {
        filter: brightness(100%);
    }
}
@keyframes chat-button-slide-in-right {
    0% {
      -webkit-transform: translateX(200%);
      transform: translateX(200%);
    }
    50% {
        -webkit-transform: translateX(0%);
        transform: translateX(0%);
    }
    60% {
        filter: brightness(80%);
    }
    80%{
        filter: brightness(120%);
    }
    100% {
        filter: brightness(100%);
    }
}
  
