	color: #333333;
	margin-bottom:1.5rem;
	margin-top:0.5rem;
}
#logMeIn input[type="text"] {
	border-radius: 2px;
	border: 1px solid #CBCBCB;
    color: #333;
    font-size: 1rem;
    font-weight: 500;
    height: 44px;
    margin: 0 0 20px;
    padding: 10px 17px;
