	height:12px;
	margin-left:10px;
}
#logMeIn #noPin.active a:after {
	content:url('assets/capi/up_blue.svg');
	width:12px;
	height:12px;
	margin-left:10px;
}
#showExpand {
	display:none;
	margin-top:16px;
}
#showExpand a:hover {
	text-decoration:underline;	
}

#logMeIn .button {
	margin-top: 5px;
    margin-bottom: 20px;
	height: 44px;
    background: #0467C6;
    border-radius: 2px;	
}
a.button, input[type='submit'].button {
	font-size:16px;
	line-height:24px;
	font-weight:400;
	padding:10px 20px; 	
}
