.innerBorder tr:last-child td {  border-bottom: 0;}
.innerBorder tr td:first-child,.innerBorder tr th:first-child {  border-left: 0;}
.innerBorder tr td:last-child,.innerBorder tr th:last-child {  border-right: 0;}

