    content: '';
    background: #dfecf4 url('assets/capi/images/issueDetails_blue.png') no-repeat center 15px;
}

ul#servTickets_breadcrumb li.selected.issueDetails:before {
    content: '';
    background: url('assets/capi/images/blueCircle_1.png');
    width: 28px;
    height: 28px;
    position: absolute;
    top: 75px;
    left: 50%;
    margin-left: -14px;
}

ul#servTickets_breadcrumb li.selected.contactInfo {
    background: #dfecf4 url('assets/capi/images/addressContactInfo_blue.png') no-repeat center 15px;
}

ul#servTickets_breadcrumb li.selected.contactInfo:before {
    content: '';
    background: url('assets/capi/images/blueCircle_2.png');
    width: 28px;
    height: 28px;
    position: absolute;
    top: 75px;
    left: 50%;
    margin-left: -14px;
}

ul#servTickets_breadcrumb li.selected.additionalInfo {
    content: '';
    background: #dfecf4 url('assets/capi/images/additionalInfo_blue.png') no-repeat center 15px;
}

ul#servTickets_breadcrumb li.selected.additionalInfo:before {
    content: '';
    background: url('assets/capi/images/blueCircle_3.png');
    width: 28px;
    height: 28px;
    position: absolute;
    top: 75px;
    left: 50%;
    margin-left: -14px;
}

ul#servTickets_breadcrumb li.selected.verifySubmit {
    content: '';
    background: #dfecf4 url('assets/capi/images/verifySubmit_blue.png') no-repeat center 15px;
}

ul#servTickets_breadcrumb li.selected.verifySubmit:before {
    content: '';
    background: url('assets/capi/images/blueCircle_4.png');
    width: 28px;
    height: 28px;
    position: absolute;
    top: 75px;
    left: 50%;
    margin-left: -14px;
}

ul#servTickets_breadcrumb li.selected:after {
    content: '';
    width: 20px;
    height: 88px;;
    background: url('assets/capi/images/LightBlueArrow.png');
    position: absolute;
    top: 0px;
    right: -20px;
    z-index: 50;
}
ul#servTickets_breadcrumb li.selected.verifySubmit:after {content:'';}

ul#servTickets_breadcrumb li.preSelected {
    border-bottom:5px solid #72a000;
    padding: 20px;
    box-sizing:border-box;
    -moz-box-sizing:border-box;
    -webkit-box-sizing:border-box;
    position:relative;
}
ul#servTickets_breadcrumb li.preSelected:before {
    content: '';
    background: url('assets/capi/images/greenCircle_checkmark.png');
    width: 28px;
    height: 28px;
