#whereToBuy {float: none; padding: 0 !important; margin: 0 !important; background: none;}

fieldset {border: 1px solid #000;}

a:link, a:visited {
   color: #520;
   background: transparent;
   font-weight: bold;
   text-decoration: underline;
}

a[href]:after {
  content: none !important;
}

#featuredItem {text-align: left;}
.banner {display: none;}

ul, ol {float: none !important; margin: auto; padding: inherit;}

dl {display: block; float: none !important; width: auto;}

.floatRight, .floatLeft, .right, .left {float: none !important; display: block;}
.last {float: left !important;}

.printOnly {display: block;}


/* START OF - Find a Post Office Location */
.forPrint_googleMap .search-bar, .forPrint_googleMap dl.tabs, .forPrint_googleMap #main { display:none;}

.forPrint_googleMap #contentWrap #resultContents.tabs-content,
.forPrint_googleMap #map_canvas { 
    position:absolute;
    margin-left:-1000px;
}

.forPrint_googleMap #map_canvasPrint {
    height: 400px;
    width: 700px;	
    position:relative;
    margin-left:15px;
    overflow:hidden !important;
}

.forPrint_googleMap #map_canvasPrint .gm-style-cc, #mapOfAll .gm-style-cc {
    display:none;
}

.forPrint_googleMap .psage-break  {
    display: block; page-break-before: always;
}

#topSiteMessageWrapper.warn {
    position:absolute;
    left:-1000px;  
}
/* END OF - Find a Post Office Location */


.footer-containerBlue, footer, header{display:none;}
.button{border:1px solid black;}

#feedback-tab{display:none !important;}
#smartbanner {  position:absolute; left:0;  top:0; border-bottom:1px solid #e8e8e8; width:100%; height:78px; border-color:#fff;background:#fff;box-shadow: none; margin-bottom:20px;}
#smartbanner .sb-container { margin: 0 auto; }
#smartbanner, html.sb-animation {-webkit-transition: all .3s ease;}
#smartbanner .sb-close {  position:absolute; left:5px; top:5px; display:block; border:2px solid #fff; width:14px; height:14px; font-size:15px; line-height:15px; text-align:center; color:#fff; background:#070707; text-decoration:none;  border:0; width:17px; height:17px; line-height:17px; color:#7b7b7b; font-size:24px; background:none; margin-top: 35px; margin-left: 10px;  }
#smartbanner .sb-close:active { color:#7b7b7b; font-size:13px; }
#smartbanner .sb-icon { position:absolute; left:30px; top:10px; display:block; width:57px; height:57px; background:rgba(0,0,0,0.6); background-size:cover; border-radius:10px;  }
#smartbanner.no-icon .sb-icon { display:none; }
#smartbanner .sb-info { position:absolute; left:38px; top:18px; width:60%; font-size:11px; line-height:1.2em; font-weight:bold; color:#6a6a6a;  }
#smartbanner .sb-info { color:#333333; background:url('assets/capi/cp-icon-mobile.png') no-repeat; padding-left:80px; padding:5px 0px 10px 65px;} 
#smartbanner .sb-info strong { color:#333333; display:block; font-size:13px; color:#4d4d4d; line-height: 18px; }
#smartbanner .sb-info > span { display:block; }
#smartbanner .sb-info em { font-style:normal; text-transform:uppercase; }
#smartbanner #smartbanner.no-icon .sb-info { left:34px; }


#smartbanner .sb-button { position:absolute; right:15px; top:35px; padding: 0; font-size:14px; text-align:center; font-weight:bold; color:#087cc0;  text-decoration:none;  }

